import React from 'react';

const TableHead = () => {
    return (
        <thead className="table-dark">
        <tr>
            <th className="fontifyr">Title</th>
            <th className="fontifyr">Genre</th>
            <th className="fontifyr">Stock</th>
            <th className="fontifyr">Rate</th>
            <th />
        </tr>
        </thead>
    );
};

export default TableHead;
